Let me think through this step by step...

**Key Psychological Mechanisms:**

1. **Fairness:** Responders are likely to consider the fairness of the proposed split.  A split perceived as unfair is less likely to be accepted.  Fairness can be defined relative to the contribution of each player.

2. **Self-Interest:** Responders will prioritize maximizing their own monetary gain.  A higher proposed share for themselves will increase the likelihood of acceptance.

**How these Mechanisms Interact:**

Fairness and self-interest are likely to interact. A responder might accept an unfair offer if the monetary gain is sufficiently high, indicating a trade-off between fairness and self-interest.

**Mathematical Form:**

We can model the utility of accepting an offer as a weighted combination of fairness and self-interest.  Fairness can be captured by the difference between the proposed split percentage for the responder and a fair split percentage (defined as the ratio of the responder's tokens to the total tokens).  Self-interest is simply the proposed amount for the responder.

**Parameters:**

1.  `fairness_weight`: This parameter reflects the relative importance of fairness compared to self-interest. A higher value indicates a greater sensitivity to fairness.  (Learnable)

2. `self_interest_sensitivity`:  This parameter determines the sensitivity of the utility to the magnitude of the self-interest component.  A higher value implies that small increases in the monetary gain are more impactful (Learnable).


**Mapping Variables to Observable Behavior:**

The model will predict the utility of accepting an offer based on the fairness of the offer and the amount offered to the responder. A higher utility value indicates a higher likelihood of acceptance. The model will only predict the behavior of responders.

