def simulate_model(trial_data, fairness_weight=1, self_interest_sensitivity=1):
    utility_values = []
    for trial in trial_data:
        try:
            split_self = trial["split_self"]
            token_self = trial["token_self"]
            token_opp = trial["token_opp"]
            splitperc_self = trial["splitperc_self"]

            #Handle potential division by zero
            if (token_self + token_opp) == 0:
                fairness_term = 0 #Avoid division by zero.  Could also raise an exception.
            else:
                fairness_term = splitperc_self - (token_self / (token_self + token_opp)) * 100

            utility = self_interest_sensitivity * split_self + fairness_weight * fairness_term
            utility_values.append(utility)
        except KeyError as e:
            print(f"Error processing trial: Missing key {e}. Skipping trial.")
            utility_values.append(float('nan')) # Append NaN for missing data
    return utility_values
